INSERT INTO `libro` (`id`, `codigo`, `titulo`, `autor`, `fecha_publicacion`, `resumen`, `imagen`, `paginas`, `novedad`, `id_tipolibro`) VALUES
(1, '1234', 'El Señor de los Anillos', 'J. R. R. Tolkien', '1954-06-29 19:52:36', 'La novela narra el viaje del protagonista principal, Frodo Bolsón, hobbit de la Comarca, para destruir el Anillo Único y la consiguiente guerra que provocará el enemigo para recuperarlo, ya que es la principal fuente de poder de su creador, el Señor oscuro, Sauron.', 1, 1392, 0, 1),
(2, '0412', 'Battle Royale', 'Koushun Takami', '1999-04-27 08:37:10', 'En la República del Gran Oriente Asiático está prohibido el rock. Como medida de control de rebeliones, la administración pone en marcha el Programa: cada año, 50 clases de distintos institutos son elegidas para luchar a muerte en la BATTLE ROYALE. Los alumnos elegidos son aislados en una isla. Las normas del juego son estrictas: no pueden escapar, no pueden contactar con el exterior, y solo puede quedar uno. Todo está permitido para sobrevivir.', 2, 688, 0, 2),
(3, '7283', 'IT', 'Stephen king', '1988-09-15 16:22:46', 'Cuenta la historia de un grupo de siete niños que son aterrorizados por un malvado monstruo, al que llaman «Eso», que es capaz de cambiar de forma, alimentándose del terror que produce en sus víctimas. ', 3, 1504, 0, 3),
(4, '0021', 'La Historia Interminable', 'Michael Ende', '2022-01-21 14:44:24', 'La Emperatriz Infantil está mortalmente enferma y su reino, Fantasia, corre un grave peligro. La salvación depende de Atreyu, un valiente guerrero de la tribu de los pieles verdes, y Bastian, un niño tímido que lee con pasión un libro mágico. Solo un ser humano puede salvar este lugar encantado.', 4, 420, 0, 4),
(5, '3167', 'Harry Potter y la piedra filosofal', 'J. K. Rowling', '1997-06-26 00:00:00', 'Harry Potter se ha quedado huérfano y vive en casa de sus abominables tíos y el insoportable primo Dudley. Harry se siente muy triste y solo, hasta que un buen día recibe una carta que cambiará su vida para siempre. En ella le comunican que ha sido aceptado como alumno en el Colegio Hogwarts de Magia. A partir de ese momento, la suerte de Harry da un vuelco espectacular.', 5, 223, 0, 4),
(6, '9645', 'La Bestia', 'Carmen Mola', '2021-11-04 16:15:28', 'Corre el año 1834 y Madrid, una pequeña ciudad que trata de abrirse paso más allá de las murallas que la rodean, sufre una terrible epidemia de cólera. Pero la peste no es lo único que aterroriza a sus habitantes: en los arrabales aparecen cadáveres desmembrados de niñas que nadie reclama. Todos los rumores apuntan a la Bestia, un ser a quien nadie ha visto pero al que todos temen. Cuando la pequeña Clara desaparece, su hermana Lucía, junto con Donoso, un policía tuerto, y Diego, un periodista buscavidas, inician una frenética cuenta atrás para encontrar a la niña con vida. En su camino tropiezan con fray Braulio, un monje guerrillero, y con un misterioso anillo de oro con dos mazas cruzadas que todo el mundo codicia y por el que algunos están dispuestos a matar.', 6, 544, 1, 5),
(7, '3742', 'El último Catón', 'Matilde Asensi', '2001-02-01 11:00:00', 'Desde el archivo secreto de la ciudad del Vaticano, la hermana Ottavia Salina, paleógrafa de prestigio internacional, se enfrenta a un extraño enigma: descifrar los tatuajes aparecidos en el cadáver de un etíope. Con la ayuda de un capitán de la guardia suiza y un arqueólogo de Alejandría, Ottavia tendrá que descubrir quién está detrás del robo en las iglesias de todo el mundo de las reliquias de la Vera Cruz, la cruz de Cristo. Siete pruebas basadas en el purgatorio de la Divina comedia de Dante Alighieri tienen las llaves para abrir las puertas. La expiación de los siete pecados capitales se realizará en las siete ciudades que ostentan la fama de practicarlos: Roma por su soberbia, Rávena por su envidia, Jerusalén por su ira, Atenas por su pereza, Constantinopla por su avaricia, Alejandría por su gula y Antioquía por su lujuria.', 7, 640, 0, 5),
(8, '6368', 'Los Juegos del Hambre', 'Suzanne Collins', '2008-09-14 05:34:00', 'Es la hora. Ya no hay vuelta atrás. Los juegos van a comenzar. Los tributos deben salir a la Arena y luchar por sobrevivir. Ganar significa Fama y riqueza, perder significa la muerte segura... ¡Que empiecen los Septuagésimo Cuartos Juegos del Hambre! Un pasado de guerras ha dejado los 12 distritos que dividen Panem bajo el poder tiránico del Capitolio. Sin libertad y en la pobreza, nadie puede salir de los límites de su distrito. Sólo una chica de 16 años, Katniss Everdeen, osa desafiar las normas para conseguir comida. Sus prinicipios se pondrán a prueba con Los juegos del hambre, espectáculo televisado que el Capitolio organiza para humillar a la población. Cada año, 2 representantes de cada distrito serán obligados a subsistir en un medio hostil y luchar a muerte entre ellos hasta que quede un solo superviviente.', 8, 374, 0, 9),
(9, '9863', 'El Libro Negro de las Horas', 'Eva Garcia Saenz de Urturi', '2022-02-02 08:40:00', 'Alguien que lleva muerto cuarenta años no puede ser secuestrado y, desde luego, no puede sangrar. Vitoria, 2022. El exinspector Unai López de Ayala -alias Kraken- recibe una llamada anónima que cambiará lo que cree saber de su pasado familiar: tiene una semana para encontrar el legendario Libro Negro de las Horas, una joya bibliográfica exclusiva, si no, su madre, quien descansa en el cementerio desde hace décadas, morirá. ¿Cómo es esto posible? Una carrera contrarreloj entre Vitoria y el Madrid de los bibliófilos para trazar el perfil criminal más importante de su vida, uno capaz de modificar el pasado, para siempre.', 9, 384, 1, 5),
(10, '7564', 'Reina Roja', 'Juan Gómez-Jurado', '2018-11-08 08:24:00', 'Antonia Scott es especial. Muy especial. No es policía ni criminalista. Nunca ha empuñado un arma ni llevado una placa, y, sin embargo, ha resuelto decenas de crímenes. Pero hace un tiempo que Antonia no sale de su ático de Lavapiés. Las cosas que ha perdido le importan mucho más que las que esperan ahí fuera. Tampoco recibe visitas. Por eso no le gusta nada, nada, cuando escucha unos pasos desconocidos subiendo las escaleras hasta el último piso. Sea quien sea, Antonia está segura de que viene a buscarla. Y eso le gusta aún menos.', 10, 568, 0, 5),
(11, '4636', 'Ángeles y Demonios', 'Dan Brown', '2000-03-01 11:00:00', 'El profesor de simbología Robert Langdon recibe una misteriosa llamada a las tantas de la madrugada y se ve envuelto en una persecución en la que tratará de evitar la destrucción de la Ciudad del Vaticano. Acompañado de la científica Vittoria Vetra, ambos deberán encontrar la guarida de los Illuminati para detener a un hombre cuyo propósito es hacer explotar la antimateria y destruir el altar principal de la Iglesia junto a todas las personas que estén a su alrededor. ', 11, 688, 0, 5),
(12, '9043', 'El Italiano', 'Arturo Pérez-Reverte', '2021-09-21 05:33:00', 'En los años 1942 y 1943, durante la Segunda Guerra Mundial, buzos de combate italianos hundieron o dañaron catorce barcos aliados en Gibraltar y la bahía de Algeciras. En esta novela, inspirada en hechos reales, sólo algunos personajes y situaciones son imaginarios. Elena Arbués, una librera de veintisiete años, encuentra una madrugada mientras pasea por la playa a uno de esos buzos, desvanecido entre la arena y el agua. Al socorrerlo, la joven ignora que esa determinación cambiará su vida y que el amor será sólo parte de una peligrosa aventura.', 12, 400, 1, 1);

